(224, 133, '_tmm_head', 'a:4:{i:0;a:15:{s:14:\"_tmm_firstname\";s:7:\"Sarwan \";s:13:\"_tmm_lastname\";s:5:\"Gill \";s:8:\"_tmm_job\";s:5:\"Owner\";s:9:\"_tmm_desc\";s:267:\"<p style=\"text-align: center\">Sarwan founded Miripiri Services in 2023 drawing from over 10 years of industry experience. Originally from Punjab, he takes immense pride in delivering personalized service and building lasting relationships with every client.&nbsp;</p>\";s:10:\"_tmm_photo\";s:97:\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-09-at-3.08.45-PM.jpeg\";s:14:\"_tmm_photo_url\";s:0:\"\";s:13:\"_tmm_sc_type1\";s:8:\"facebook\";s:14:\"_tmm_sc_title1\";s:8:\"Facebook\";s:12:\"_tmm_sc_url1\";s:25:\"https://www.facebook.com/\";s:13:\"_tmm_sc_type2\";s:8:\"whatsapp\";s:14:\"_tmm_sc_title2\";s:8:\"Whatsapp\";s:12:\"_tmm_sc_url2\";s:25:\"https://www.whatsapp.com/\";s:13:\"_tmm_sc_type3\";s:5:\"phone\";s:14:\"_tmm_sc_title3\";s:5:\"Phone\";s:12:\"_tmm_sc_url3\";s:15:\"+61 470 352 595\";}i:1;a:15:{s:14:\"_tmm_firstname\";s:8:\"Gurjeet \";s:13:\"_tmm_lastname\";s:6:\"Singh \";s:8:\"_tmm_job\";s:7:\"Manager\";s:9:\"_tmm_desc\";s:279:\"<p style=\"text-align: center\">As our manager, Gurjeet expertly coordinates projects and personnel.&nbsp; Gurjeet holds a certification in Management and enjoys imparting his knowledge to train new hires. When not at work, you can find him playing cricket with his local team.</p>\";s:10:\"_tmm_photo\";s:97:\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-09-at-3.09.17-PM.jpeg\";s:14:\"_tmm_photo_url\";s:0:\"\";s:13:\"_tmm_sc_type1\";s:8:\"facebook\";s:14:\"_tmm_sc_title1\";s:8:\"Facebook\";s:12:\"_tmm_sc_url1\";s:25:\"https://www.facebook.com/\";s:13:\"_tmm_sc_type2\";s:8:\"whatsapp\";s:14:\"_tmm_sc_title2\";s:8:\"Whatsapp\";s:12:\"_tmm_sc_url2\";s:25:\"https://www.whatsapp.com/\";s:13:\"_tmm_sc_type3\";s:5:\"phone\";s:14:\"_tmm_sc_title3\";s:5:\"Phone\";s:12:\"_tmm_sc_url3\";s:15:\"+61 470 352 595\";}i:2;a:15:{s:14:\"_tmm_firstname\";s:6:\"Simar \";s:13:\"_tmm_lastname\";s:5:\"Gill \";s:8:\"_tmm_job\";s:29:\"Lead Painter/Paint Specialist\";s:9:\"_tmm_desc\";s:255:\"<p style=\"text-align: center\">With over 3 years as a professional painter under her belt, Simar heads our team of skilled painters and renovation specialists. She is detail-oriented and always keeps up with the latest techniques and eco-paint options.</p>\";s:10:\"_tmm_photo\";s:97:\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-09-at-3.07.46-PM.jpeg\";s:14:\"_tmm_photo_url\";s:0:\"\";s:13:\"_tmm_sc_type1\";s:8:\"facebook\";s:14:\"_tmm_sc_title1\";s:8:\"Facebook\";s:12:\"_tmm_sc_url1\";s:25:\"https://www.facebook.com/\";s:13:\"_tmm_sc_type2\";s:8:\"whatsapp\";s:14:\"_tmm_sc_title2\";s:8:\"whatsapp\";s:12:\"_tmm_sc_url2\";s:25:\"https://www.whatsapp.com/\";s:13:\"_tmm_sc_type3\";s:5:\"phone\";s:14:\"_tmm_sc_title3\";s:5:\"Phone\";s:12:\"_tmm_sc_url3\";s:15:\"+61 470 352 595\";}i:3;a:15:{s:14:\"_tmm_firstname\";s:7:\"Harmeet\";s:13:\"_tmm_lastname\";s:4:\"Kaur\";s:8:\"_tmm_job\";s:12:\"Lead Cleaner\";s:9:\"_tmm_desc\";s:261:\"<p style=\"text-align: center\">Harmeet brings exceptional diligence and knowledge of green cleaning practices to every job. She enjoys transforming messy spaces into clean and welcoming environments. Harmeet is expert in carpet cleaning and pressure washing.</p>\";s:10:\"_tmm_photo\";s:97:\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-09-at-3.08.23-PM.jpeg\";s:14:\"_tmm_photo_url\";s:0:\"\";s:13:\"_tmm_sc_type1\";s:8:\"facebook\";s:14:\"_tmm_sc_title1\";s:8:\"Facebook\";s:12:\"_tmm_sc_url1\";s:25:\"https://www.facebook.com/\";s:13:\"_tmm_sc_type2\";s:8:\"whatsapp\";s:14:\"_tmm_sc_title2\";s:8:\"whatsapp\";s:12:\"_tmm_sc_url2\";s:25:\"https://www.whatsapp.com/\";s:13:\"_tmm_sc_type3\";s:5:\"phone\";s:14:\"_tmm_sc_title3\";s:5:\"Phone\";s:12:\"_tmm_sc_url3\";s:15:\"+61 470 352 595\";}}'),
