(237, 1, '2023-08-10 05:00:42', '2023-08-10 05:00:42', '<!-- wp:paragraph -->\n<p>We use powerful truck-mounted cleaning systems and the latest tools and technologies to deep clean your carpets down to the base fibres. Expert carpet cleaning removes embedded dirt, stains, allergens and restores the fluffiness your carpets had when they were new. Contact us today!</p>\n<!-- /wp:paragraph -->', 'Carpet Cleaning', '', 'inherit', 'closed', 'closed', '', '234-revision-v1', '', '', '2023-08-10 05:00:42', '2023-08-10 05:00:42', '', 234, 'http://localhost/miripiri/?p=237', 0, 'revision', '', 0),
(239, 1, '2023-08-10 05:18:35', '2023-08-10 05:18:35', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-large-font-size\"><strong>Miripiri Services </strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">A locally owned and operated business providing top-quality cleaning, maintenance and renovation services in Brisbane.  MiriPiri services provide a variety of the best services and work possible to both the commercial and home markets, all in conformity with Australian Standards. Sarwan and Gurjeet both adhere to the belief that success is primarily determined by how well and quickly a task is completed. After using the service, thousands of Australian families and companies are now aware of the “MiriPiris difference\" and why they are market leaders.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":97,\"width\":210,\"height\":210,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full is-resized\"><img src=\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-03-at-5.48.47-PM.jpeg\" alt=\"\" class=\"wp-image-97\" width=\"210\" height=\"210\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"typography\":{\"fontSize\":\"25px\"}}} -->\n<p class=\"has-text-align-center\" style=\"font-size:25px\"><strong>Who are we?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"> We are founded in 2023 by owner Sarwan Gill, Miripiri Services has deep roots in the community. Mr Gill\'s extensive experience in the industry and dedication to hands-on service has allowed us to become a leading provider of bonded cleaning, carpet care, painting and more for residential and commercial clients.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\"><strong>Our Team</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">We are proud to employ a staff of highly trained and experienced service professionals who share our values of honesty, reliability and attention to detail. Our team members include:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>[tmm name=\"teams\"]</p>\n<!-- /wp:paragraph -->', 'About us', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2023-08-10 05:18:35', '2023-08-10 05:18:35', '', 12, 'http://localhost/miripiri/?p=239', 0, 'revision', '', 0),
(241, 1, '2023-08-10 05:34:01', '2023-08-10 05:34:01', '<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>Let us redefine your spaces, making them gleam with cleanliness and radiate with renewed charm. Contact MiriPiri Services today for a free quote, and let\'s embark on a journey to transform your property into a masterpiece</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"clientId\":\"91e8536a-a0f1-47b6-b0aa-ce6a9603dccf\",\"formId\":\"45\",\"fieldBorderColor\":\"#000000\",\"copyPasteJsonValue\":\"{\\u0022displayTitle\\u0022:false,\\u0022displayDesc\\u0022:false,\\u0022fieldSize\\u0022:\\u0022medium\\u0022,\\u0022fieldBorderRadius\\u0022:\\u00223px\\u0022,\\u0022fieldBackgroundColor\\u0022:\\u0022#ffffff\\u0022,\\u0022fieldBorderColor\\u0022:\\u0022#000000\\u0022,\\u0022fieldTextColor\\u0022:\\u0022rgba( 0, 0, 0, 0.7 )\\u0022,\\u0022labelSize\\u0022:\\u0022medium\\u0022,\\u0022labelColor\\u0022:\\u0022rgba( 0, 0, 0, 0.85 )\\u0022,\\u0022labelSublabelColor\\u0022:\\u0022rgba( 0, 0, 0, 0.55 )\\u0022,\\u0022labelErrorColor\\u0022:\\u0022#d63637\\u0022,\\u0022buttonSize\\u0022:\\u0022medium\\u0022,\\u0022buttonBorderRadius\\u0022:\\u00223px\\u0022,\\u0022buttonBackgroundColor\\u0022:\\u0022#066aab\\u0022,\\u0022buttonTextColor\\u0022:\\u0022#ffffff\\u0022}\"} /-->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"><strong>General Service Pricing</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\"><em>(The general price for some services may differ from a personalized quoted price.</em>)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table {\"hasFixedLayout\":true,\"backgroundColor\":\"cyan-bluish-gray\",\"className\":\"is-style-stripes\"} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-cyan-bluish-gray-background-color has-backgroun