(265, 1, '2023-08-14 02:35:35', '2023-08-14 02:35:35', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-large-font-size\"><strong>Miripiri Services </strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">A locally owned and operated business providing top-quality cleaning, maintenance and renovation services in Brisbane.  MiriPiri services provide a variety of the best services and work possible to both the commercial and home markets, all in conformity with Australian Standards. Sarwan and Gurjeet both adhere to the belief that success is primarily determined by how well and quickly a task is completed. After using the service, thousands of Australian families and companies are now aware of the “MiriPiris difference\" and why they are market leaders.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":97,\"width\":210,\"height\":210,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full is-resized\"><img src=\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-03-at-5.48.47-PM.jpeg\" alt=\"\" class=\"wp-image-97\" width=\"210\" height=\"210\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"typography\":{\"fontSize\":\"25px\"}}} -->\n<p class=\"has-text-align-center\" style=\"font-size:25px\"><strong>Who are we?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"> We are founded in 2023 by owner Sarwan Gill, Miripiri Services has deep roots in the community. Mr Gill\'s extensive experience in the industry and dedication to hands-on service has allowed us to become a leading provider of bonded cleaning, carpet care, painting and more for residential and commercial clients.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\"><strong>Our Team</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">We are proud to employ a staff of highly trained and experienced service professionals who share our values of honesty, reliability and attention to detail. Our team members include:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>[tmm name=\"teams\"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>[depicter id=\"68\"]</p>\n<!-- /wp:paragraph -->', 'About us', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2023-08-14 02:35:35', '2023-08-14 02:35:35', '', 12, 'http://localhost/miripiri/?p=265', 0, 'revision', '', 0),
(266, 1, '2023-08-14 02:37:06', '2023-08-14 02:37:06', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-large-font-size\"><strong>Miripiri Services </strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">A locally owned and operated business providing top-quality cleaning, maintenance and renovation services in Brisbane.  MiriPiri services provide a variety of the best services and work possible to both the commercial and home markets, all in conformity with Australian Standards. Sarwan and Gurjeet both adhere to the belief that success is primarily determined by how well and quickly a task is completed. After using the service, thousands of Australian families and companies are now aware of the “MiriPiris difference\" and why they are market leaders.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":97,\"width\":210,\"height\":210,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image aligncenter size-full is-resized\"><img src=\"http://localhost/miripiri/wp-content/uploads/2023/08/WhatsApp-Image-2023-08-03-at-5.48.47-PM.jpeg\" alt=\"\" class=\"wp-image-97\" width=\"210\" height=\"210\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"typography\":{\"fontSize\":\"25px\"}}} -->\n<p class=\"has-text-align-center\" style=\"font-size:25px\"><strong>Who are we?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"ce