(299, 1, '2023-08-14 05:27:38', '2023-08-14 05:27:38', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"fontSize\":\"large\"} -->\n<h2 class=\"wp-block-heading has-text-align-center has-large-font-size\"><strong>Miripiri Services </strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">A locally owned and operated business providing top-quality cleaning and painting services in Brisbane.  MiriPiri services provide a variety of the best services and work possible to both the commercial and home markets, all in conformity with Australian Standards. Sarwan and Gurjeet both adhere to the belief that success is primarily determined by how well and quickly a task is completed. After using the service, thousands of Australian families and companies are now aware of the “MiriPiris difference\" and why they are market leaders.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator has-alpha-channel-opacity\"/>\n<!-- /wp:separator -->\n\n<!-- wp:video {\"id\":297} -->\n<figure class=\"wp-block-video\"><video controls src=\"http://localhost/miripiri/wp-content/uploads/2023/08/MiriPiriCleaning.mp4\"></video></figure>\n<!-- /wp:video -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"style\":{\"typography\":{\"fontSize\":\"25px\"}}} -->\n<p class=\"has-text-align-center\" style=\"font-size:25px\"><strong>Who are we?</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">We were founded in 2023 by owner Sarwan Gill. Even though the company is new, Mr Gill brings over a decade of industry experience to every job, having worked in cleaning and painting for 10 years before starting Miripiri Services. With his hands-on approach and dedication to exceptional service, Miripiri Services has quickly become a leading provider of bonded cleaning, carpet care, painting and more for residential and commercial clients.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph {\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\"><strong>Our Team</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">We are proud to employ a staff of highly trained and experienced service professionals who share our values of honesty, reliability and attention to detail. Our team members include:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>[tmm name=\"teams\"]</p>\n<!-- /wp:paragraph -->', 'About us', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2023-08-14 05:27:38', '2023-08-14 05:27:38', '', 12, 'http://localhost/miripiri/?p=299', 0, 'revision', '', 0),
(300, 1, '2023-08-14 05:36:02', '2023-08-14 05:36:02', '<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p><strong>Contact Miripiri Services</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"clientId\":\"a45103fe-d589-4f0c-87b6-a6611252fed6\",\"formId\":\"191\",\"copyPasteJsonValue\":\"{\\u0022displayTitle\\u0022:false,\\u0022displayDesc\\u0022:false,\\u0022fieldSize\\u0022:\\u0022medium\\u0022,\\u0022fieldBorderRadius\\u0022:\\u00223px\\u0022,\\u0022fieldBackgroundColor\\u0022:\\u0022#ffffff\\u0022,\\u0022fieldBorderColor\\u0022:\\u0022rgba( 0, 0, 0, 0.25 )\\u0022,\\u0022fieldTextColor\\u0022:\\u0022rgba( 0, 0, 0, 0.7 )\\u0022,\\u0022labelSize\\u0022:\\u0022medium\\u0022,\\u0022labelColor\\u0022:\\u0022rgba( 0, 0, 0, 0.85 )\\u0022,\\u0022labelSublabelColor\\u0022:\\u0022rgba( 0, 0, 0, 0.55 )\\u0022,\\u0022labelErrorColor\\u0022:\\u0022#d63637\\u0022,\\u0022buttonSize\\u0022:\\u0022medium\\u0022,\\u0022buttonBorderRadius\\u0022:\\u00223px\\u0022,\\u0022buttonBackgroundColor\\u0022:\\u0022#066aab\\u0022,\\u0022buttonTextColor\\u0022:\\u0022#ffffff\\u0022}\"} /-->', 'Contact Us', '', 'inherit', 'closed', 'closed', '', '158-revision-v1', '', '', '2023-08-14 05:36:02', '2023-08-14 05:36:02', '', 158, 'http://localhost/miripiri/?p=300', 0, 'revision', '', 0),
(301, 1, '2023-08-14 06:09:52', '2023-08-14 06:09:52', '<!-- wp:spacer -->\n<div style=\"height:100px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:paragraph -->\n<p>Let us redefine your spaces, making them gleam with cleanliness and radiate with renewed charm. Contact MiriPiri Services today for a free quote, and let\'s embark on a journey to transform your property into a masterpiece</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:wpforms/form-selector {\"clientId\":\"91e8536a-a0f1-47b6-b0aa-ce6a9603dccf\",\"formId\":\"45\",\"fieldBorderColor\":\"#000000\",\"copyPasteJsonValue\":\"{\\u0022displayTitle\\u0022:false,\\u0022displayDesc\\u0022:false,\\u0022fieldSize\\u0022:\\u0022medium\\u0022,\\u0022fieldBorderRadius\\u0022:\\u00223px\\u0022,\\u0022fieldBackgroundColor\\u0022:\\u0022#ffffff\\u0022,\\u0022fieldBorderColor\\u0022:\\u0022#000000\\u0022,\\u0022fieldTextColor\\u0022:\\u0022rgba( 0, 0, 0, 0.7 )\\u0022,\\u0022labelSize\\u0022:\\u0022medium\\u0022,\\u0022labelColor\\u0022:\\u0022rgba( 0, 0, 0, 0.85 )\\u0022,\\u0022labelSublabelColor\\u0022:\\u0022rgba( 0, 0, 0, 0.55 )\\u0022,\\u0022labelErrorColor\\u0022:\\u0022#d63637\\u0022,\\u0022buttonSize\\u0022:\\u0022medium\\u0022,\\u0022buttonBorderRadius\\u0022:\\u00223px\\u0022,\\u0022buttonBackgroundColor\\u0022:\\u0022#066aab\\u0022,\\u0022buttonTextColor\\u0022:\\u0022#ffffff\\u0022}\"} /-->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\"><strong>General Service Pricing</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\"><em>(The general price for some services may differ from a personalized quoted price.</em>)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:table {\"hasFixedLayout\":true,\"backgroundColor\":\"cyan-bluish-gray\",\"className\":\"is-style-stripes\"} -->\n<figure class=\"wp-block-table is-style-stripes\"><table class=\"has-cyan-bluish-gray-background-color has-background has-fixed-layout\"><thead><tr><th>Services</th><th> Estimated Price</th></tr></thead><tbody><tr><td>Domestic Cleaning ( 3 Rooms)</td><td>AUD 110</td></tr><tr><td>Bond Cleaning ( 3 Rooms)</td><td>AUD 420</td></tr><tr><td>Commercial Cleaning </td><td>Varies based on office size</td></tr><tr><td>House Painting ( 3 Rooms)</td><td>AUD 7500<br></td></tr><tr><td>Carpet Cleaning (Medium Room)</td><td>AUD 55</td></tr><tr><td>Roof Painting</td><td>AUD 150 per sq m</td></tr><tr><td>Window Cleaning</td><td>AUD 5 per window</td></tr></tbody></table><figcaption class=\"wp-element-caption\">Contact us to get an exact price for the Service you want.   <strong><a href=\"tel:470 352 595\" data-type=\"tel\" data-id=\"tel:470 352 595\">Call us</a></strong></figcaption></figure>\n<!-- /wp:table -->\n\n<!-- wp:paragraph -->\n<p> </p>\n<!-- /wp:paragraph -->', 'Get a free quote', '', 'inherit', 'closed', 'closed', '', '49-revision-v1', '', '', '2023-08-14 06:09:52', '2023-08-14 06:09:52', '', 49, 'http://localhost/miripiri/?p=301', 0, 'revision', '', 0),
